import React from 'react'
import { BrowserRouter, Routes, Route } from 'react-router-dom'
import Main from './AppFlow/MainScreen/Main'

const AppRouter = () => {
    return(
        <p>Home</p>
    )
}

export default function App() {
    return (
            <Routes>
                <Route path='/' element={<AppRouter/>}/>
            </Routes>
    )
}
